import React from "react";

function Navbar() {
  return (
    <nav className="navbar">
      <div>
        <h1>Project Zeus</h1>
      </div>
      <div>
        <ul className="nav-routes">
          <li>Home</li>
          <li>Catalogue</li>
          <li>Checkout</li>
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
